import React from 'react';
import axios from 'axios';
import Target from './Target';


class HitListContainer extends React.Component {
  constructor() {
    super();
    this.state = {
      targets: []
    }
  }

  componentDidMount() {
    axios.get('https://s3.amazonaws.com/v-school/data/hitlist.json').then((res)=>{
      let targArray = [];
      for (let i =0; i < res.data.length; i++) {
        targArray.push(res.data[i]);
      }
      this.setState({
        targets: targArray
      })
    });
  }

  wrapperStyles = {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    backgroundImage: "url('data:image/jpeg;base64,')"
  }

  HitListStyles = {
    display: 'grid',
    gridTemplateColumns: '400px 400px',
    gap: '7px',
    marginBottom: '50px'
  }

  headerStyle = {
    height: '89px',
    backgroundColor: 'goldenrod',
    width: '100%',
    marginBottom: '15px',
    display: 'flex',
    alignItems: 'center'
  }

  titleSty = {
    marginLeft: '25px'
  }

  pic = {
    width: '80px',
    height: '80px'
  }

  render() {
    
    let targetComponents = this.state.targets.map((target)=>{
      return <Target key={target.name + Math.random()*5} name={target.name} image={target.image} />
    })

    return (
      <div style={this.wrapperStyles}>
        <div style={this.headerStyle}>
          <img style={this.pic} src="http://pngimg.com/uploads/gangster/gangster_PNG77.png" alt=""/>
          <h1 style={this.titleSty}>Hit List</h1>
        </div>
        <div style={this.HitListStyles}>
          {targetComponents}
        </div>
      </div>
    )
  }

}


export default HitListContainer;
